INSERT INTO `taskapp_tasktype1` VALUES (1,'Какой смысл имеют коэффициенты  и  в общем уравнении прямой:  ..?',' это координаты точек, в которых прямая','','',''),(2,'Как скоро будет новый год?','Уже очень скоро','task/images/task-3581.jpg','Новый год — праздник, наступающий в момент перехода с последнего дня года в первый день следующего года. Отмечается многими народами в соответствии с принятым календарём. Начало года с 1 января было установлено римским правителем Юлием Цезарем в 46 году до нашей эры[1]. В Древнем Риме этот день был посвящён Янусу — богу выбора, дверей и всех начал. Месяц январь получил своё название в честь бога Януса, которого изображали с двумя лицами: одно смотрело вперёд, а другое — назад[2].',''),(3,'За полторы недели до начала июля он обратился к Ливии со словами \"Живи и прощай!\". Так в \"Хрониках Харона\" описывается начало июля. Напишите слова, которые мы заменили словами \"начало июля\".QQQQ','Конец августаQQQ','','Он - Гай Юлий Цезарь Август, скончавшийся 19 августа. Ливия Друзилла - супруга императора. \"Хроники Харона\" - книга-исследование темы смерти.\r\n','');
