INSERT INTO `taskapp_tasktype2` VALUES (1,'Коэффициенты  ,  и  в общем уравнении плоскости:  это…','task/images/task-5206.jpg',4,'',''),(2,'На фото изображен ...','task/images/task-6959.jpg',5,'',''),(3,'Столица России?','task/images/task-2321.jpg',9,'Столица России — главный город российского государства, политический и административный центр страны. На протяжении истории эту роль играли несколько городов. С 1918 года и по настоящее время столицей России является город Москва.','task/images/task-2321-explanation-image.jpg'),(4,'Решите дробно-рациональное уравнение $$\\frac{(у^3 + у^2 - 12у)}{ ((у - 3)(у + 2)} = 0$$. Если корней несколько, запишите в ответ их среднее арифметическое.','',13,'Дробь в математике — число, состоящее из одной или нескольких частей (долей) единицы[1]. Дроби являются частью поля рациональных чисел. По способу записи дроби делятся на два формата: обыкновенные вида $${\\displaystyle \\pm {\\frac {m}{n}}} \\pm {\\frac {m}{n}}$$ и десятичные.','task/images/task-5278-explanation-image.jpg'),(5,'Что это за поверхность второго порядка?','task/images/task-2822_K6dqdiT.jpg',18,'Это эллипсоид','task/images/task-2822-explanation-image_OtG2jgY.jpg'),(6,'Что это за поверхность второго порядка?','task/images/task-3801.jpg',23,'Это однополостный гиперболоид','task/images/task-3801-explanation-image_i7MHUxv.jpg'),(7,'Что это за поверхность второго порядка?','task/images/task-5947_50AzkDe.jpg',29,'Это эллипсоид.','task/images/task-5947-explanation-image_v4Pm7dd.jpg'),(8,'Что это за поверхность второго порядка?','task/images/task-6589_lrfac0y.jpg',83,'Это эллипсоид.','task/images/task-6589-explanation-image_LW37zIG.jpg'),(9,'Что это за поверхность второго порядка?','task/images/task-8245.jpg',37,'Это эллипсоид','task/images/task-8245-explanation-image_OVrx9hJ.jpg'),(10,'Что это за поверхность второго порядка?','task/images/task-2363.jpg',91,'Это эллипсоид.','task/images/task-2363-explanation-image_tUUAyyM.jpg'),(11,'Что это за поверхность второго порядка?','