ус',''),(50,'Определить аффинный тип поверхности, заданной уравнением $$-\\frac{x^2}{4}+2y^2-z^2=1.$$','',291,'Это двуполостный гиперболоид',''),(51,'Определить аффинный тип поверхности, заданной уравнением $$-x^2-2y^2+z^2=-1.$$','',293,'Это однополостный гиперболоид',''),(52,'Определить аффинный тип поверхности, заданной уравнением $$x^2-2yz=1.$$','',302,'Это однополостный гиперболоид',''),(53,'Определить аффинный тип поверхности, заданной уравнением \r\n$$-\\frac{x^2}{2}-\\frac{y^2}{3}-\\frac{z^2}{4}=-1.$$','',307,'Это эллипсоид',''),(54,'Определить аффинный тип поверхности, заданной уравнением $$z^2+4y^2=\\frac{x^2}{4}-1.$$','',313,'Это двуполостный гиперболоид',''),(55,'Определить аффинный тип поверхности, заданной уравнением $$z^2-2y^2=-1-\\frac{x^2}{4}.$$','',321,'Это двуполостный гиперболоид',''),(56,'Определить аффинный тип поверхности, заданной уравнением $$x^2+2y^2+3z^2=4.$$','',327,'Это эллипсоид',''),(57,'Определить аффинный тип поверхности, заданной уравнением $$y^2+\\frac{z^2}{4}-1=-3x^2.$$','',335,'Это эллипсоид',''),(58,'Определить аффинный тип поверхности, заданной уравнением \r\n$$x^2+\\frac{y^2}{2}+\\frac{z^2}{4}+5=0.$$','',338,'Это мнимый эллипсоид',''),(59,'Определить аффинный тип поверхности, заданной уравнением \r\n$$x^2+y^2+z^2=1-x-y-z.$$','',345,'Это эллипсоид',''),(60,'Определить аффинный тип поверхности, заданной уравнением $$x^2+2y^2+2z^2+2x-2y+4z=-1.$$','',355,'Это эллипсоид $$(x+1)^2+2(y-\\frac{1}{2})^2+2(z+1)^2=\\frac{5}{2}$$',''),(61,'Определить аффинный тип поверхности, заданной уравнением $$x^2+y^2+4z^2=-6-2x+2y+8z.$$','',360,'Это мнимый конус $$(x+1)^2+(y-1)^2+4(z-1)^2=0.$$',''),(62,'Определить аффинный тип поверхности, заданной уравнением \r\n$$x^2-y^2+2z^2-2x+2y+4z=1.$$','',364,'Это однополостный гиперболоид $$(x-1)^2-(y-1)^2+2(z+1)^2=3.$$',''),(63,'Определить аффинный тип поверхности, заданной уравнением $$x^2+y^2+z^2=0.$$','',373,'Это мнимый конус',''),(64,'Определить аффинный тип поверхности, заданной уравнением $$x^2+y^2+z^2=2z.$$','',379,'Это эллипсоид $$x^2+y^2+(z-1)^2=1.$$',''),(65,'Определить аффинный тип поверхности, заданной уравнением $$z^2-2x^2-3y^2=0.$$','',387,'Это конус',''),(66,'Определить аффинный тип поверхности, заданной уравнением $$x^2+2yz=0.$$','',392,'Это конус',''),(67,'Определить аффинный тип поверхности, заданной уравнением $$xyz=1.$$','',405,'Это не поверхность второго порядка, поскольку уравнение имеет порядок 3.',''),(68,'Определить аффинный тип поверхности, заданной уравнением \r\n$$\\frac{x^2}{9}+\\frac{y^2}{4}+\\frac{z^2}{1}=\\cos\\frac{5\\pi}{8}.$$','',407,'Это мнимый эллипсоид, поскольку $$\\cos\\frac{5\\pi}{8}<0$$.',''),(69,'Определить аффинный тип поверхности, заданной уравнением $$x^2-2y^2=2z+1.$$','',414,'Это гиперболический параболоид',''),(70,'Определить аффинный тип поверхности, заданной уравнением $$x^2+y^2=3z.$$','',420,'Это эллиптический параболоид',''),(71,'Определить аффинный тип поверхности, заданной уравнением $$xy=2z.$$','',430,'Это гиперболический параболоид','task/images/task-9524-explanation-image.jpg'),(72,'Определить аффинный тип поверхности, заданной уравнением \r\n$$\\frac{9}{x^2}+\\frac{4}{y^2}+\\frac{1}{z^2}=1.$$','',439,'Это не поверхность второго порядка.',''),(73,'Определить аффинный тип поверхности, заданной уравнением \r\n$$\\frac{x^2}{4}+\\frac{y^2}{9}=-2z.$$','',442,'Это эллиптический параболоид',''),(74,'Определить аффинный тип поверхности, заданной уравнением $$(x-y)^2-(x+2y)^2+z=1.$$','',452,'Это гиперболический параболоид',''),(75,'Определить аффинный тип поверхности, заданной уравнением $$20x^2+30y^2-100z^2=1.$$','',454,'Это однополостный гиперболоид',''),(76,'Определить аффинный тип поверхности, заданной уравнением \r\n$$\\frac{\\sin^2 x}{9}+\\frac{\\sin^2 y}{4}-\\frac{\\sin^2 z}{1}=-1.$$','',465,'Это не поверхность второго порядка',''),(77,'Определить аффинный тип поверхности, заданной уравнением $$(2x-1)^2+\\frac{(y+2)^2}{4}-(z+4)^2=-7.$$','',467,'Это двуполостный гиперболоид',''),(78,'Определить аффинный тип поверхности, заданной уравнением $$(x-2y)(x+2y)=4z^2.$$','',476,'Это конус',''),(79,'Определить аффинный тип поверхности, заданной уравнением $$(y-2x)(y+2x)=4z.$$','',481,'Это гиперболический параболоид $$-4x^2+y^2=4z$$.',''),(80,'Определить аффинный тип поверхности, заданной уравнением $$x^2+\\frac{y^2}{4}=1-z.$$','',486,'Это эллиптический параболоид',''),(81,'Определить аффинный тип поверхности, заданной уравнением $$x^2+3z^2=1.$$','',495,'Это эллиптический цилиндр',''),(82,'Определить аффинный тип поверхности, заданной уравнением \r\n$$\\frac{x^2}{2}+\\frac{y^2}{3}+1=0.$$','',500,'Это мнимый эллиптический цилиндр',''),(83,'Определить аффинный тип поверхности, заданной уравнением $$x^2+2xy+y^2+3z^2=4.$$','',508,'Это эллиптический цилиндр',''),(84,'Определить аффинный тип поверхности, заданной уравнением $$xy=3.$$','',512,'Это гиперболический цилиндр',''),(85,'Определить аффинный тип поверхности, заданной уравнением $$x(x-y)=-1.$$','',519,'Это гиперболический цилиндр',''),(86,'Определить аффинный тип поверхности, заданной уравнением $$2x^2+z^2=2z.$$','',525,'Это эллиптический цилиндр $$2x^2+(z-1)^1=1.$$',''),(87,'Определить аффинный тип поверхности, заданной уравнением $$2y^2+3z^2=0.$$','',532,'Это пара мнимых пересекающихся плоскостей',''),(88,'Определить аффинный тип поверхности, заданной уравнением $$(x-2y+z)(2x-y-3z)=4.$$','',542,'Это гиперболический цилиндр',''),(89,'Определить аффинный тип поверхности, заданной уравнением $$x+xz+1=0.$$','',546,'',''),(90,'Определить аффинный тип поверхности, заданной уравнением $$y^2-2x^2=0.$$','',551,'Это пара пересекающихся прямых',''),(91,'Определить аффинный тип поверхности, заданной уравнением $$(x-2y+3z)^2-(2x-y+z)^2=0.$$','',560,'Это пара пересеающихся плоскостей $$(x-2y+3z)=\\pm(2x-y+z).$$',''),(92,'Определить аффинный тип поверхности, заданной уравнением $$x^2+4xz+4z^2=1.$$','',566,'Это пара параллельных плоскостей $$x+2z=\\pm 1$$.',''),(93,'Определить аффинный тип поверхности, заданной уравнением $$(x-y)^2-2z=0.$$','',576,'Это параболический цилиндр',''),(94,'Определить аффинный тип поверхности, заданной уравнением $$x^2+4x+2z=6.$$','',578,'Это параболический цилиндр $$(x+2)^2=-2(z-5).$$',''),(95,'Определить аффинный тип поверхности, заданной уравнением $$ x^2=-2z^2.$$','',587,'Это пара мнимых пересекающихся плоскостей',''),(96,'Определить аффинный тип поверхности, заданной уравнением $$(x+2y-3z-1)(3x-2y+4z-1)=0.$$','',591,'Это пара пересекающихся плосостей.',''),(97,'Определить аффинный тип поверхности, заданной уравнением $$(x+2y-3z-1)^2-4=0.$$','',599,'Это пара параллельных плоскостей $$x+2y-3z-1=\\pm 2$$.',''),(98,'Определить аффинный тип поверхности, заданной уравнением $$(x+2y-3z-1)^2=2z^2.$$','',608,'Это пара пересекающихся плоскостей',''),(99,'Определить аффинный тип поверхности, заданной уравнением $$x^2+2xz+z^2=0.$$','',615,'Это пара совпадающих плоскостей $$x+z=0.$$',''),(100,'Определить аффинный тип поверхности, заданной уравнением $$x^3+1=0.$$','',624,'Это не поверхность второго порядка, поскольку уравнение имеет порядок 3.',''),(101,'Определить аффинный тип поверхности, заданной уравнением $$y^2-z^2=2z+1.$$','',626,'Это пара пересекающихся плоскостей',''),(102,'Определить аффинный тип поверхности, заданной уравнением $$z^2+1=0.$$','',634,'Это пара мнимых параллельных плоскостей',''),(103,'По какому множеству касательная плоскость пересекает однополостный гиперболоид?','',639,'Касательная плоскость пересекает однополостный гиперболоид по паре пересеающихся прямых, являющихся его прямолинейными образующими.','task/images/task-4774-explanation-image.jpg'),(104,'По какому множеству касательная плоскость пересекает гиперболичесий параболоид?','',647,'Касательная плоскость пересекает гиперболический параболоид по паре пересеающихся прямых, являющихся его прямолинейными образующими.','task/images/task-3629-explanation-image.jpg'),(105,'По какому множеству касательная плоскость пересекает двуполостный гиперболоид?','',650,'Касательная плоскость пересекает двуполостный гиперболоид по точке.','task/images/task-1365-explanation-image.jpg'),(106,'По какому множеству касательная плоскость пересекает гиперболический цилиндр?','',657,'Касательная плоскость пересекает гиперболический цилиндр по прямой, являющейся его образующей.','task/images/task-6402-explanation-image.jpg'),(107,'По какому множеству касательная плоскость пересекает конус?','',661,'Касательная плоскость пересекает конус по прямой, являющейся его образующей.','task/images/task-3421-explanation-image.jpg'),(108,'Какая из следующих кривых второго порядка не может быть плоским сечением однополостного гиперболоида?','',668,'Плоскими сечениями однополостного гиперболоида могут быть: эллипс, гипербола, парабола, пара пересекающихся прямых и пара параллельных прямых.',''),(109,'Сколько различных касательных плоскостей к эллиптическому параболоиду можно провести через точку, находящуюся \"снаружи\" по отношению к нему?','',674,'Через точку, находящуюся \"снаружи\" от эллиптического параболоида проходит бесконечно много касательных плоскостей.',''),(110,'Какая из следующих кривых второго порядка не может быть плоским сечением конуса?','',679,'Мнимый эллипс не может быть плоским сечением конуса, поскольку пересечение конуса с произвольной плоскостью непусто.',''),(111,'Какая из следующих кривых второго порядка не может быть плоским сечением эллиптического цилиндра?','',684,'Пара мнимых пересеающихся прямых представляет собой множество, состоящее из одной точки. Любая плоскость в пересечении с эллиптическим цилиндром дает либо пустое множество, либо множество, состояшее из бесконечного количества точек.',''),(112,'Сколько асимптотических направлений имеет однополостный гиперболоид?','',692,'Однополостный гиперболоид имеет бесконечно много асимптотических направлений, поскольку направление любой прямой, лежащей на его асимптотическом конусе, является асимптотическим.','task/images/task-3662-explanation-image.jpg'),(113,'Сколько асимптотических направлений имеет двуполостный гиперболоид?','',697,'Двуполостный гиперболоид имеет бесконечно много асимптотических направлений, поскольку направление любой прямой, лежащей на его асимптотическом конусе, является асимптотическим.','task/images/task-1448-explanation-image.jpg'),(114,'Сколько асимптотических направлений имеет эллиптический цилиндр?','',699,'Единственным асимптотическим направлением эллиптического цилиндра является направление его образующей.','task/images/task-4380-explanation-image.jpg'),(115,'Сколько асимптотических направлений имеет гиперболический цилиндр?','',707,'Гиперболический цилиндр имеет бесконечно много асимптотических направлений, поскольку направление любой прямой, лежащей в одной из его асимптотических плоскостей, является асимптотическим.','task/images/task-9287-explanation-image.jpg'),(116,'Сколько асимптотических направлений имеет гиперболический параболоид?','',712,'Гиперболический параболоид имеет бесконечно много асимптотических направлений, поскольку направление любой его прямолинейной образующей является асимптотическим.','task/images/task-5524-explanation-image_Y6AWjIq.jpg'),(117,'Сколько асимптотических направлений имеет эллиптический параболоид?','',714,'Единственным асимптотическим направлением эллиптического параболоида является направление его оси симметрии.','task/images/task-9441-explanation-image.jpg'),(118,'Сколько асимптотических направлений имеет параболический цилиндр?','',722,'Параболический цилиндр имеет бесконечно много асимптотических направлений, поскольку направление любой прямой, лежащей на его плоскости симметрии, является асимптотическим.','task/images/task-4258-explanation-image.jpg'),(119,'Найти геометрическое место точек в трехмерном пространстве, равноудаленных от заданной прямой.','',725,'Геометрическим местом точек в трехмерном пространстве, равноудаленных от заданной прямой, является круговой цилиндр, ось которого совпадает с данной прямой.','task/images/task-5311-explanation-image.jpg'),(120,'Найти геометрическое место точек в трехмерном пространстве, сумма расстояний от которых до двух заданных точек постоянна.','',732,'Геометрическим местом точек в трехмерном пространстве, сумма расстояний от которых до двух заданных точек постоянна, является эллипсоид вращения с фокусами в данных точках.','task/images/task-7100-explanation-image.jpg'),(121,'Найти геометрическое место точек в трехмерном пространстве, равноудаленных от заданной точки и заданной плоскости.','',737,'Геометрическим местом точек в трехмерном пространстве, равноудаленных от заданной точки и заданной плоскости, является эллиптический параболоид вращения, фокусом и директориальной плоскостью которого являются заданная точка и заданная плоскость соответственно.','task/images/task-8584-explanation-image.jpg'),(122,'Найти геометрическое место точек в трехмерном пространстве, равноудаленных от двух заданных скрещивающихся прямых.','',745,'Геометрическим местом точек в трехмерном пространстве, равноудаленных от двух заданных скрещивающихся прямых, является гиперболический параболоид, каноническими осями которого служат биссектрисы углов между ортогональными проекциями данных прямых на плоскость, им параллельную, и проходящую через середину их общего перпендикуляра, и прямая, содержащая этот общий перпендинуляр.','task/images/task-6125-explanation-image_QE9VVh1.jpg'),(123,'Через каждую точку гиперболы проведена прямая, параллельная заданной прямой, пересакающей плоскость гиперболы. Определить аффинный тип поверхности, получаемой объединением всех таких прямых.','',752,'Это гиперболический цилиндр, образующими которого являются эти прямые.','task/images/task-3032-explanation-image_RLY4zSb.jpg'),(124,'Через данную точку и всевозможные точки на гиперболе проведены прямые. Определить аффинный тип поверхности, образованной этими прямыми.','',758,'Это конус с вершиной в данной точке.','task/images/task-1869-explanation-image.jpg'),(125,'Через данную точку и всевозможные точки на параболе проведены прямые. Определить аффинный тип поверхности, образованной этими прямыми.','',767,'Это конус с вершиной в данной точке, одна из образующих которого параллельна плоскости параболы.','task/images/task-3145-explanation-image_We9zL8J.jpg'),(126,'По какому множеству касательная плоскость не может пересекать поверхность второго порядка?','',771,'Касательная плоскость не может пересекать поверхность второго порядка по гиперболе. По паре пересекающихся плоскостей касательная плоскость пересекает однополостный гиперболоид и гиперболический параболоид, по паре совпадающих прямых, например, цилиндр. А пара мнимых пересекающихся прямых представляет собой точку: этот случай реализуется, например, для эллипсоида.',''),(127,'Дана прямая, не имеющая общих точек с эллиптическим параболоидом. Сколько касательных плоскостей к этому параболоиду проходит через данную прямую?','',776,'Две касательных плоскости.','task/images/task-9100-explanation-image.jpg'),(128,'Дана прямая, не имеющая общих точек с гиперболическим параболоидом. Сколько касательных плоскостей к этому параболоиду проходит через данную прямую?','',779,'Ни одной, поскольку если предположить, что такая плоскость существует, то она должна пересекать параболоид по паре пересекающих прямых, являющихся прямолинейными образующими. Значит, по крайней мере одна из этих прямых должна пересекать данную прямую, что противоречит условию.',''),(129,'Дана прямая, не имеющая общих точек с однополостным гиперболоидом. Сколько касательных плоскостей к этому гиперболоиду проходит через данную прямую?','',784,'Ни одной, поскольку если предположить, что такая плоскость существует, то она должна пересекать параболоид по паре пересекающих прямых, являющихся прямолинейными образующими. Значит, по крайней мере одна из этих прямых должна пересекать данную прямую, что противоречит условию.',''),(130,'Дан произвольный эллипсоид. Сколько существует плоскостей, пересекающих его по окружности?','',794,'Таких плоскостей существует бесконечно много. Если некоторая плоскость удовлетворяет этому свойству, то также существует и бесконечное семейство паралельных ей плоскостей, удовлетворяющих этому свойству.','task/images/task-9651-explanation-image.jpg'),(131,'Дана прямая, не имеющая общих точек с двуполостным гиперболоидом. Сколько касательных плоскостей к этому гиперболоиду проходит через данную прямую?','',803,'Ответ зависит от выбора прямой. В самом деле, если, например, данная прямая проходит через вершину асимптотического конуса, то через нее не проходит ни одна касательная плоскость. А если, например, взять прямую, перпендикулярную оси гиперболоида, проходящей через его вершины и пересекающую эту ось в точке, отличной от вершины асимптотического конуса, то касательных плоскости будет две.',''),(132,'Даны две скрещивающиеся прямые, не являющиеся перпендикулярными. Определить аффинный тип поверхности, которую образуют всевозможные прямые, получаемые вращением первой прямой относительно второй.','',807,'При таком вращении получится однополостный гиперболоид вращения, осью которого будет вторая прямая, а все прямые получаемые вращением первой, будут его прямолинейными образующими, принадлежащими одному семейству.','task/images/task-2127-explanation-image.jpg'),(133,'Для какой из этих поверхностей существует плоскость, не имеющая с ней общих точек?','',811,'Гиперболический цилиндр. Например, его асимптотическая плоскость не имеет с ним одщих точек.','task/images/task-4761-explanation-image.jpg'),(134,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-1513.jpg',815,'',''),(135,'Дан произвольный эллиптический параболоид. Сколько существует плоскостей, пересекающих его по окружности?','',824,'Таких плоскостей существует бесконечно много. Если некоторая плоскость удовлетворяет этому свойству, то также существует и бесконечное семейство паралельных ей плоскостей, удовлетворяющих этому свойству.',''),(136,'Какая из следующих кривых второго порядка не может быть плоским сечением гиперболического параболоида?','',827,'Пара параллельных прямых не может быть плоским сечением гиперболического параболоида. Его плоскими сечениями являются лишь парабола, гипербола и пара пересекающихся прямых.',''),(137,'Какая из следующих кривых второго порядка не может быть плоским сечением двуполостного гиперболоида?','',834,'Пара мнимых параллельных прямых не может быть плоским сечением двуполостного гиперболоида. Его плоскими сечениями являются эллипс, гипербола, парабола, точка и пустое множество. Точка получается, если рассмотреть плоскость, проходящую через его вершину перпендикулярно его оси (которая содержит вершины). При ограничении уравнения двуполостного гиперболоида на эту плоскость, получится уравнение второго порядка, которое имеет аффинный тип пары мнимых пересекающих прямых. При ограничении уравнения двуполостного гиперболоида на плоскость, его не пересекающую, получится уравнение второго порядка, имеющее аффинный тип мнимого эллипса, а не пары мнимых параллельных прямых. Поэтому пустое множество в данном случае следует интерпретировать именно как мнимый эллипс, а не как пару мнимых параллельных прямых.',''),(138,'Какая из следующих поверхностей второго порядка никогда не может получиться в результате вращения прямой вокруг некоторой оси в пространстве?','',837,'Никакой гиперболический параболоид не может быть получен вращением никакой прямой. Круговой конус и круговой цилиндр получаются вращением своих образующих, а однополостный гиперболоид вращения получается в результате вращения любой из своих прямолинейных образующих вокруг его оси.',''),(139,'Возьмем параболу, заданную уравнением $$x=\\frac{z^2}{4}+1$$  в плоскости Oxz и провращаем ее на угол $$2\\pi$$ радиан вокруг оси Oz. Какая в результате получится проверхность?','',842,'Полученная поверхность вблизи плоскости $$Oxy$$ будет внешне немного напоминать однополостный гиперболоид, но таковым являться не будет. Дело в том, что при достаточно большом удалении от оси вращения касательная плоскость к такой поверхности будет все ближе и ближе к горизонтальной, а у однополостного гиперболоида вращения (он получается вращением подходящей гиперболы) в аналогичной ситуации касательная плоскость будет неограниченно приближаться к асимптотическому конусу.','task/images/task-7720-explanation-image.jpg'),(140,'Плоским сечением какой из следующих поверхностей не может являться парабола?','',847,'Парабола не может являться плоским сечением никакого гиперболического цилиндра.',''),(141,'Плоским сечением какой из следующих поверхностей не может являться эллипс?','',854,'Эллипс не может являться плоским сечением никакого гиперболического параболоида.',''),(142,'Плоским сечением какой из следующих поверхностей не может являться гипербола?','',858,'Гипербола не может быть плоским сечением никакого эллиптического параболоида.',''),(143,'В плоскости, расположенной вертикально, задана парабола, ось которой также вертикальна, а ветви направлены вверх. Другая парабола, расположенная в вертикальной плоскости, перпендикулярной первой, с вертикальной осью и ветвями, направленными вниз, перемещается вдоль первой параболы таким образом, что вершина второй параболы всегда находится на первой. Какую поверхность образуют точки второй параболы?','',865,'Это гиперболический параболоид.','task/images/task-3870-explanation-image.jpg'),(144,'В плоскости, расположенной вертикально, задана парабола, ось которой также вертикальна, а ветви направлены вверх. Другая парабола, расположенная в вертикальной плоскости, перпендикулярной первой, с вертикальной осью и ветвями, направленными вверх, перемещается вдоль первой параболы таким образом, что вершина второй параболы всегда находится на первой. Какую поверхность образуют точки второй параболы?','',869,'Это эллиптический параболоид.','task/images/task-8801-explanation-image.jpg'),(145,'По какому множеству плоскость, параллельная только одной из образующих конуса, пересекает этот конус?','',872,'Такая плоскость пересекает конус по параболе.','task/images/task-2495-explanation-image.jpg'),(146,'По какому множеству плоскость, перпендикулярная оси конуса и пересекающая ее в точке, отличной от его вершины, пересекает этот конус?','',878,'Такая плоскость пересекает конус по эллипсу.',''),(147,'По какому множеству плоскость, параллельная оси конуса, пересекает этот конус?','',887,'Такая плоскость пересекает конус по гиперболе.','task/images/task-2375-explanation-image.jpg'),(148,'По какому множеству плоскость, параллельная одной из образующих асимптотического конуса двуполостного гиперболоида, пересекает этот двуполостный гиперболоид?','',893,'Такая плоскость пересекает двуполостный гиперболоид по параболе.','task/images/task-6183-explanation-image.jpg'),(149,'По какому множеству плоскость, параллельная оси асимптотического конуса двуполостного гиперболоида, пересекает этот двуполостный гиперболоид?','',899,'Такая плоскость пересекает двуполостный гиперболоид по гипероболе.','task/images/task-2740-explanation-image.jpg'),(150,'По какому множеству плоскость, параллельная одной из образующих асимптотического конуса однополостного гиперболоида, пересекает этот однополостный гиперболоид?','',903,'Такая плоскость пересекает однополостный гиперболоид по параболе.','task/images/task-1461-explanation-image.jpg'),(151,'По какому множеству плоскость, параллельная оси асимптотического конуса однополостного гиперболоида, пересекает этот гиперболоид?','',910,'Такая плоскость пересекает однополостный гиперболоид по гиперболе.','task/images/task-7277-explanation-image.jpg'),(152,'По какому множеству плоскость, параллельная двум прямолинейным образующим однополостного гиперболоида, принадлежащим к одному семейству, пересекает этот гиперболоид?','',916,'Такая плоскость пересекает однополостный гиперболоид по гиперболе.','task/images/task-9016-explanation-image.jpg'),(153,'По какому множеству плоскость, параллельная двум прямолинейным образующим гиперболического параболоида, пересекает этот параболоид?','',923,'Такая плоскость пересекает гиперболический параболоид по гиперболе.',''),(154,'Возьмем две перпендикулярные прямые. Пусть теперь одна из них с постоянной скоростью двигается по другой (оставаясь при этой перпендикулярной ей) и равномерно вращается при этом. Какую поверхность образуют точки движущейся прямой?','',930,'Точки движущейся прямой образуют поверхность, которая не является поверхностью второго порядка. Например, это можно объяснить так: за достаточно длительное время движущаяся прямая совершит вокруг оси полтора оборота. А это означает, что неподвижная прямая пересекает эту поверхность ровно в трех точкам, что невозможно для поверхностей второго порядка. Такая поверхность называется геликоидом.','task/images/task-2935-explanation-image.jpg'),(155,'Даны два непересекающихся сферы, ни одна из которых не лежит внутри другой. Какую поверхность образуют всевозможные прямые, каксающиеся этих сфер внутренним образом?','',933,'Это конус, а данные сферы являются сферами Данделена для него.','task/images/task-2919-explanation-image.jpg'),(156,'Дан эллипсоид и точка, лежащая \"снаружи\". Через эту точку проведены всевозможные касательные прямые к данному эллипсоиду. Какую поверхность образуют эти касательные?','',940,'Всевозможные касательные к эллипсоиду, проходящие через данную точку, образуют конус.','task/images/task-2790-explanation-image.jpg'),(157,'','',NULL,'',''),(158,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-2423.jpg',1035,'',''),(159,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-7941.jpg',948,'',''),(160,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-7089.jpg',1004,'',''),(161,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-8632_uEZan0o.jpg',951,'',''),(162,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-3755.jpg',1028,'',''),(163,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-4756.jpg',1022,'',''),(164,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-2235.jpg',960,'',''),(165,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-1759.jpg',962,'',''),(166,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-5045_CuY07Tm.jpg',965,'',''),(167,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-4911.jpg',970,'',''),(168,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-6308_puC7rwJ.jpg',973,'',''),(169,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-6709.jpg',974,'',''),(170,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-3481_rA5Bsen.jpg',977,'',''),(171,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-5165.jpg',980,'',''),(172,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-4223.jpg',983,'',''),(173,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-1476.jpg',988,'',''),(174,'Выберите уравнение, которое задает поверхность, изображенную на картинке.','task/images/task-9618.jpg',991,'',''),(175,'Какая из следующих прямых перпендикулярна плоскости, задаваемой уравнением $$3x+2y-z+1=0 ?$$','',1054,'Заданной плоскости перпендикулярны прямые из пунктов 1и 3, поскольку направляющие векторы прямых из пунктов 2 и 5 не параллельны нормали к плоскости, а уравнение из пункта 5 задает плоскость.',''),(176,'Какая из следующих прямых параллельна прямой, задаваемой уравнениями \r\n$$\\frac{x-3}{2}=\\frac{y+1}{3}=\\frac{x-1}{4}?$$','',1057,'Заданной прямой параллельна только прямая из пункта 3, поскольку прямая из пункта 1 совпадает с заданной прямой, прямая из пункта 2 имеет неколлинеарный направляющий вектор, а уравнение из пункта 4 задает плоскость.',''),(177,'Какая из следующих прямых паралелльна плоскости, заданной уравнением $$x-2y+5z-4=0?$$','',1065,'Заданной плоскости параллельна только прямая из пункта 5, поскольку прямая из пункта 4 содержится в этой плоскости, направляющие векторы прямых из пунктов 1 и 2 не перпендикулярны нормали этой плоскости, а в пункте 3 задано уравнение плоскости.',''),(178,'Какая из следующих прямых содержится в плоскости, задаваемой уравнением $$2x-7y+z-5=0?$$','',1070,'В заданной плоскости содержится только прямая из пункта 3, поскольку прямая из пункта 2 параллельна этой плоскости, прямые из пунктов 1 и 4 ее пересекают, а в пункте 7 задана плоскость.',''),(179,'Какая из следующих плоскостей параллельна плоскости, заданной уравнением $$3x-y+5z-2=0?$$','',1081,'Обе плоскости из пунктов 2 и 4 параллельны заданной плоскости, поскольку плоскость из пункта 1 совпадает с ней.',''),(180,'Какая из следующих прямых перпендикулярна прямой, заданной уравнениями \r\n$$\\frac{x-1}{2}=\\frac{y+2}{3}=\\frac{z-4}{1}?$$','',1086,'Прямые перпендикулярны если и только если склярное произведение их направляющих векторов равно нулю. Поэтому заданной прямой перпендикулярна только прямая из пункта 4.',''),(181,'Какая из плоскостей перпендикулярна прямой, задаваемой уравнениями \r\n$$\\frac{x+1}{1}=\\frac{y-3}{5}=\\frac{z-2}{-2}?$$','',1094,'Плоскость перпендикулярна прямой если и только если нормаль плоскости коллинеарна направляющему вектору прямой. Поэтому заданной прямой перпендикулярны плоскости из пунктов 2 и 4.',''),(182,'Какая из плоскостей принадлежит пучку, задаваемому плоскостями x-2y+3z-4=0 и \r\n2x+y-z+1=0?','',1098,'Левая часть уравнения из пункта 4 является линейной комбинацией левых частей заданных уравнений. Поэтому плоскость из пункта 4 принадлежит пучку, определяемому данными плоскостями.',''),(183,'Определить аффинный тип кривой, заданной уравнением $$1-2x^2-3y^2=0.$$','',1103,'Это эллипс.',''),(184,'Определить аффинный тип кривой, заданной уравнением $$x^2=(1-2y)(1+2y).$$','',1110,'Это эллипс.',''),(185,'Определить аффинный тип кривой, заданной уравнением $$\\frac{x^2}{2}-\\frac{y^2}{3}=-1.$$','',1113,'Это гипербола.',''),(186,'Определить аффинный тип кривой, заданной уравнением $$xy=4.$$','',1120,'Это гипербола, асимптотами которой являются координатные оси.',''),(187,'Определить аффинный тип кривой, заданной уравнением $$xy=2x.$$','',1123,'Данное уравнение представляет собой распадающуюся кривую, которая является парой пересекающихся прямых $$x=0$$ и $$y=2$$.',''),(188,'Определить аффинный тип кривой, заданной уравнением $$x^2+y^2=x.$$','',1129,'Это эллипс. Для того, чтобы убедиться в этом, достаточно выделить полный квадрат по переменной $$x$$.',''),(189,'Определить аффинный тип кривой, заданной уравнением $$x^2+y^2=x+y.$$','',1135,'Это эллипс. Для того, чтобы убедиться в этом, достаточно выделить полные квадраты по обеим переменным.',''),(190,'Определить аффинный тип кривой, заданной уравнением $$(x+y)^2=4(x+y).$$','',1141,'Данное уравнение представляет собой распадающуюся кривую. Она является парой параллельных прямых $$x+y=0$$ и $$x+y-4=0$$.',''),(191,'Определить аффинный тип кривой, заданной уравнением $$x^4+y^4=1.$$','',1147,'Это не кривая второго порядка, поскольку соответствующее уравнение имеет степень 4.',''),(192,'Определить аффинный тип кривой, заданной уравнением $$xy=0.$$','',1150,'Это уравнение задает пару пересекающихся прямых (координатные оси).',''),(193,'Определить аффинный тип кривой, заданной уравнением $$(x+2y-1)(y-x+2)=0.$$','',1154,'Это уравнение задает пару пересекающихся прямых $$x+2y-1=0$$ и $$y-x+2=0$$.',''),(194,'Определить аффинный тип кривой, заданной уравнением $$(x+2y-1)(y-x+2)=4.$$','',1164,'Это гипербола, асимптотами которой являются прямые $$x+2y-1=0$$ и $$y-x+2=0$$.',''),(195,'Определить аффинный тип кривой, заданной уравнением $$(x+2y-1)^2=y-x+3.$$','',1170,'Это парабола. Убедиться в этом можно, перейдя к аффинной системе координат, оси которой задаются уравнениями $$x+2y-1=0$$ и $$y-x+3=0$$.',''),(196,'Определить аффинный тип кривой, заданной уравнением $$\\frac{x^2}{4}+\\frac{y^2}{3}+2x+5=0.$$','',1174,'Это мнимый эллипс. Убедиться в этом можно, выделив полный квадрат по переменной $$x$$.',''),(197,'Определить аффинный тип кривой, заданной уравнением $$\\frac{x^2}{4}+\\frac{y^2}{3}+2x+4=0.$$.','',1181,'Это пара мнимых пересекающихся прямых. Убедиться в этом можно, выделив полный квадрат по переменной $$x$$.',''),(198,'Определить аффинный тип кривой, заданной уравнением $$(x-2y+7)^2-1=0.$$','',1187,'Это пара параллельных прямых.',''),(199,'Определить аффинный тип кривой, заданной уравнением $$(x-2y+7)^2+1=0.$$','',1193,'Это пара мнимых параллельных прямых.',''),(200,'Определить аффинный тип кривой, заданной уравнением $$x^2-2x+5=0.$$','',1200,'Это пара мнимых параллельных прямых, поскольку дискриминант данного квадратного трехчлена отрицателен.',''),(201,'Определить аффинный тип кривой, заданной уравнением $$x^2-2x-3=0.$$','',1205,'Это пара параллельных прямых $$x=3$$ и $$x=-1$$.',''),(202,'Определить аффинный тип кривой, заданной уравнением $$x^2-4x+4=0.$$','',1213,'Это пара совпадающих прямых, поскольку дискриминант соответствующего квадратного трехчлена равен нулю.',''),(203,'Определить аффинный тип кривой, заданной уравнением $$\\frac{x^2}{2}+\\frac{y^2}{10}=1.$$','',1215,'Это эллипс.',''),(204,'Определить аффинный тип кривой, заданной уравнением $$\\frac{(x+y)^2}{4}+\\frac{(x-y)^2}{3}-1=0.$$','',1224,'Это эллипс.',''),(205,'Определить аффинный тип кривой, заданной уравнением $$x^2-2xy+y^2=0.$$','',1228,'Это пара совпадающих прямых, поскольку левая часть заданного уравнения предтавляет собой полный квадрат.',''),(206,'Определить аффинный тип кривой, заданной уравнением $$x^2-4xy+4y^2-2x+3y+7=0.$$','',1234,'Это парабола.',''),(207,'Определить аффинный тип кривой, заданной уравнением $$(x-3y+2)^2-2x+5y-1=0.$$','',1242,'Это парабола.',''),(208,'Определить аффинный тип кривой, заданной уравнением $$(x-y-4)^2+(2x+3y+5)^2=0.$$','',1247,'Это пара мнимых пересекающихся прямых.',''),(209,'Определить аффинный тип кривой, заданной уравнением $$x^2+(x+y)^2+1=0.$$','',1255,'Это мнимый эллипс.',''),(210,'Какая из следующих кривых второго порядка не имеет асимптотических направлений?','',1264,'Мнимый эллипс не имеет асимптотических направлений.',''),(211,'Какая из следующих кривых второго порядка имеет ровно одно асимптотическое направление?','',1269,'Единственным асимптотическим направлением параболы является направление ее оси.','task/images/task-7515-explanation-image_3j7tyNr.jpg'),(212,'Какая из следующих кривых второго порядка имеет ровно два асимптотических направления?','',1273,'Гипербола имеет ровно два асимптотических направления. Это --- направления ее асимптот.','task/images/task-6341-explanation-image.jpg'),(213,'Какая из следующих кривых второго порядка имеет особые точки?','',1279,'Геометрически пара мнимых пересекающихся прямых представляет собой точку. Эта точка и является особой.',''),(214,'Какая из следующих кривых второго порядка имеет особые точки?','',1286,'Пара пересекающихся прямых имеет особую точку. Это --- точка их пересечения.',''),(215,'Какая из следующих кривых второго порядка имеет особые точки?','',1291,'Геометрически пара совпадающих прямых представляет собой прямую. Любая точка этой прямой является особой.',''),(216,'Какая из следующих кривых второго порядка не представляет собой пустое множество?','',1294,'Геометрически, пара мнимых пересекающихся прямых представляет собой одну точку.',''),(217,'Какая из следующих кривых второго порядка не имеет центра?','',1298,'Парабола не имеет центра.',''),(218,'Какая из следующих кривых второго порядка имеет более одного центра?','',1308,'Пара параллельных прямых имеет бесконечно много центров. Все эти центры лежат на прямой, параллельной данным прямым и равноудаленной от них.',''),(219,'Сколько асимптотических направлений имеет парабола?','',1311,'Парабола имеет одно асимптотическое направление. Это --- направление ее оси.','task/images/task-3456-explanation-image.jpg'),(220,'Сколько асимптотических направлений имеет гипербола?','',1317,'Гипербола имеет два асимптотических направления. Это направления ее асимптот.','task/images/task-1774-explanation-image.jpg'),(221,'Сколько асимптотических направлений имеет пара мнимых пересекающихся прямых?','',1320,'Пара мнимых пересекающихся прямых имеет эллиптический тип и поэтому у нее нет асимптотических направлений.',''),(222,'Какая из следующих точек наиболее удалена от плоскости, задаваемой уравнением \r\n$$3x-2y+z-4=0?$$','',1326,'Точка B наиболее удалена от заданной плоскости, поскольку при подстановке ее координат в левую часть уравнения плоскости получается наибольшее по модулю число.',''),(223,'Дана плоскость x-2y+5z-1=0 и точка A(3,3,1). Какие из точек B(1,4,1), C(-2,1,1), D(7,0,-1) и E(3,4,3) лежат в том же полупространстве, что и точка A?','',1334,'Точка A лежит в \"положительном\" полупространстве относительно данной плоскости. Точки D и E тоже дают плюс при подстановке в уравнение этой плоскости.','task/images/task-9519-explanation-image_10EFLgr.jpg'),(224,'Сколько различных касательных плоскостей к эллиптическому параболоиду можно провести через прямую, не имеющую с ним общих точек?','',1338,'Через прямую, не имеющую общих точек с эллиптическим параболоидом, можно провести к нему две различные касательные плоскости.',''),(225,'Какое из следующих условий является необходимым и достаточным условием того, что кривая  второго порядка является эллипсом?','',1344,'Условие $$I_2>0$$ выделяет кривые эллиптического типа. Кривая эллиптического типа является эллипсом если и только если инварианты $$I_1\\ \\hbox{и}\\ I_3$$ имеют разные знаки.',''),(226,'Какое из следующих условий является необходимым и достаточным условием того, что кривая  второго порядка является гиперболой?','',1349,'Условие $$I_2<0$$ выделяет кривые гиперболического типа. Кривая гиперболического типа является гиперболой если и только если $$I_3\\ne 0$$.',''),(227,'Какое из следующих условий является необходимым и достаточным условием того, что кривая  второго порядка является параболой?','',1353,'Условие $$I_2=0$$ выделяет кривые параболического типа. Кривая параболического типа является параболой если и только если $$I_3\\ne 0$$.',''),(228,'Какое из следующих условий является необходимым и достаточным условием того, что кривая  второго порядка является мнимым эллипсом?','',1359,'Условие $$I_2>0$$ выделяет кривые эллиптического типа. Кривая эллиптического типа является мнимым эллипсом если и только если инварианты $$I_1\\ \\hbox{и}\\ I_3$$ имеют одинаковый знак.',''),(229,'Какое из следующих условий является необходимым и достаточным условием того, что кривая  второго порядка является парой мнимых пересекающихся прямых?','',1363,'Условие $$I_2>0$$ выделяет кривые эллиптического типа. Кривая эллиптического типа является парой мнимых пересекающихся прямых если и только если $$I_3=0$$.',''),(230,'Какое из следующих условий является необходимым и достаточным условием того, что кривая  второго порядка является парой пересекающихся прямых?','',1370,'Условие $$I_2<0$$ выделяет кривые гиперболического типа. Кривая гиперболического типа является парой пересекающихся прямых если и только если $$I_3=0$$.',''),(231,'Какое из следующих условий является необходимым и достаточным условием того, что кривая  второго порядка является парой параллельных прямых?','',1377,'Условие $$I_2=0$$ выделяет кривые параболического типа, а условие $$I_3=0$$ гарантирует, что при этом кривая не является параболой. При этом случай параллельных прямых соответствует условию $$K<0$$, где $$K$$ -- полуинвариант.',''),(232,'Какое из следующих условий является необходимым и достаточным условием того, что кривая  второго порядка является парой мнимых параллельных прямых?\r\n','',1384,'Условие $$I_2=0$$ выделяет кривые параболического типа, а условие $$I_3=0$$ гарантирует, что при этом кривая не является параболой. При этом случай мнимых параллельных прямых соответствует условию $$K>0,\\ \\hbox{где}\\ K\\ \\hbox{-- полуинвариант}$$',''),(233,'Какое из следующих условий является необходимым и достаточным условием того, что кривая  второго порядка является парой совпадающих прямых?','',1391,'Условие $$I_2=0$$ выделяет кривые параболического типа, а условие $$I_3=0$$ гарантирует, что при этом кривая не является параболой. При этом случай параллельных прямых соответствует условию $$K=0,\\ \\hbox{где}\\ K\\ \\hbox{-- полуинвариант}$$.',''),(234,'По какой кривой плоскость z=4 пересекает поверхность $$x^2+3y^2+z^2=16?$$','',1395,'Плоскость z=4 имеет с данным эллипсоидом единственную общую точку (0,0,4), которая представляет собой пару мнимых пересекающихся прямых.','task/images/task-3161-explanation-image.jpg'),(235,'По какой кривой плоскость x=2 пересекает поверхность $$2x^2+y^2+5z^2-10=0?$$','',1397,'Ограничение многочлена второй степени, задающего эллипсоид $$2x^2+y^2+5z^2-10=0$$ на плоскость $$x=2$$ дает эллипс $$y^2+5z^2=2$$.','task/images/task-7885-explanation-image.jpg'),(236,'По какой кривой плоскость y=5 пересекает поверхность $$\\frac{x^2}{4}+y^2+\\frac{z^2}{3}=1?$$','',1404,'Геометрически пересечение представляет собой пустое множество, но алгебраически оно задается уравнением мнимого эллипса.','task/images/task-6951-explanation-image.jpg'),(237,'Дана поверхность $$x^2+2y^2+5z^2=10$$ и точечный источник света, расположенный в точке (2,1,5). Какая кривая является границей тени, отбрасываемой этой поверхностью, на плоскости z=-3?','',1409,'Границей тени является эллипс, получающийся при пересечении конуса, образующие которого проходят через точку (2,1,5) и касаются данного эллипсоида, и плоскости z=-3.',''),(238,'Дан эллипсоид $$\\frac{x^2}{5}+\\frac{y^2}{2}+\\frac{z^2}{4}=1$$ и точечный источник света, расположенный в точке (6,7,2). Какой кривой является граница тени, отбрасываемой при этом эллипоидом на плоскость z=-5?','',1415,'Рассмотрим конус с вершиной в точке (6,7,2), образующими которого является касательные, проведенные из этой точки к данному эллипсоиду. Нетрудно заметить, что одна из этих касательных параллельна плоскости $z=-5$. Но плоскость, параллельная ровно одной образующей конуса, пересекает этот конус по параболе.',''),(239,'По какой кривой плоскость z=5 пересекает поверхность $$x^2+\\frac{y^2}{4}-\\frac{z^2}{9}=1?$$','',1421,'Плоскость z=5 пересекает данный однополостный гиперболоид по эллипсу, поскольку ограничение уравнения гиперболоида на эту плоскость имеет вид $$x^2+\\frac{y^2}{4}=\\frac{34}{9}.$$','task/images/task-2670-explanation-image.jpg'),(240,'По какой кривой плоскость y=3 пересекает поверхность $$\\frac{x^2}{4}+y^2-\\frac{z^2}{3}=1?$$','',1424,'Плоскость y=3 пересекает заданный однополостный гиперболоид по гиперболе, поскольку ограничение уравнения гиперболоида на эту плоскость имеет вид $$\\frac{x^2}{4}-\\frac{z^2}{3}=-8.$$','task/images/task-5241-explanation-image.jpg'),(241,'По какой кривой плоскость x=4 пересекает поверхность $$\\frac{x^2}{2}+\\frac{y^2}{4}-\\frac{z^2}{5}=1?$$','',1430,'Плоскость x=4 пересекает заданный однополостный гиперболоид по гиперболе, поскольку ограничение уравнения гиперболоида на плоскость x=4 имеет вид $$\\frac{y^2}{4}-\\frac{z^2}{5}=-7.$$','task/images/task-4089-explanation-image.jpg'),(242,'По какой кривой плоскость z=2 пересекает поверхность $$\\frac{x^2}{4}-\\frac{y^2}{9}+\\frac{z^2}{4}=1?$$','',1437,'Плоскость z=2 пересекает данный однополостный гиперболоид по паре пересекающихся прямых (которые являются его прямолинейными образующими), поскольку ограничение уравнения гиперболоида на плоскость z=2 имеет вид $$\\frac{x^2}{4}-\\frac{y^2}{9}=0.$$','task/images/task-4204-explanation-image.jpg'),(243,'По какой кривой плоскость z=5 пересекает поверхность $$\\frac{x^2}{4}+y^2-\\frac{z^2}{4}=-1?$$','',1440,'Плоскость z=5 пересекает данный двуполостный гиперболоид по эллипсу, поскольку ограничение уравнения гиперболоида на эту плоскость имеет вид $$\\frac{x^2}{4}+y^2=\\frac{21}{4}.$$','task/images/task-4148-explanation-image.jpg'),(244,'По какой кривой плоскость z=-2 пересекает поверхность $$x^2+\\frac{y^2}{2}-\\frac{z^2}{4}=-1?$$','',1450,'Плоскость z=-2 пересекает данный двуполостный гиперболоид по паре мнимых пересекающихся прямых (геометрически это точка), поскольку ограничение уравнения гиперболоида на плоскость имеет вид $$x^2+\\frac{y^2}{2}=0.$$','task/images/task-3557-explanation-image.jpg'),(245,'По какой кривой плоскость z=1 пересекает поверхность $$\\frac{x^2}{4}+y^2-\\frac{z^2}{3}=-1?$$','',1454,'Плоскость z=1 пересекает данный двуполостный гиперболоид по мнимому эллипсу (геометрически они не пересекаются), поскольку ограничение уравнения гиперболоида на эту плоскость имеет вид $$\\frac{x^2}{4}+y^2=-\\frac{2}{3}.$$','task/images/task-2723-explanation-image.jpg'),(246,'По какой кривой плоскость y=1 пересекает поверхность $$\\frac{x^2}{4}+y^2-\\frac{z^2}{9}=-1?$$','',1458,'Плоскость y=1 пересекает данный двуполостный гиперболоид по гиперболе, поскольку ограничение уравнения гиперболы на эту плоскость имеет вид $$\\frac{x^2}{4}-\\frac{z^2}{9}=-2.$$','task/images/task-6561-explanation-image.jpg'),(247,'По какой кривой плоскость y=-2 пересекает поверхность $$-x^2-\\frac{y^2}{16}+\\frac{z^2}{9}=1?$$','',1465,'Плоскость y=-2 пересекает данный двуполостный гиперболоид по гиперболе, поскольку ограничение уравнения гиперболоида на эту плоскость имеет вид $$-x^2+\\frac{z^2}{9}=\\frac{5}{4}.$$','task/images/task-8194-explanation-image.jpg'),(248,'По какой кривой плоскость z=4 пересекает поверхность $$\\frac{x^2}{4}+y^2-\\frac{z^2}{16}=0?$$','',1469,'Плоскость z=4 пересекает данный конус по эллипсу, поскольку ограничение уравнения конуса на эту плоскость имеет вид $$\\frac{x^2}{4}+y^2=1.$$','task/images/task-4478-explanation-image.jpg'),(249,'По какой кривой плоскость z=0 пересекает поверхность $$\\frac{x^2}{5}+\\frac{y^2}{4}-\\frac{z^2}{3}=0?$$','',1478,'Плоскость z=0 пересекает данный конус по пара мнимых пересекающихся прямых (геометрически это точка, являющаяся вершиной конуса), поскольку ограничение уравнения конуса на эту плоскость имеет вид $$\\frac{x^2}{5}+\\frac{y^2}{4}=0.$$','task/images/task-9245-explanation-image.jpg'),(250,'По какой кривой плоскость y=-3 пересекает поверхность $$\\frac{x^2}{2}+\\frac{y^2}{4}-\\frac{z^2}{2}=0?$$','',1482,'Плоскость y=-3 пересекает данный конус по гиперболе, поскольку ограничение уравнения гиперболы на эту прямую имеет вид $$\\frac{x^2}{2}-\\frac{z^2}{2}=-\\frac{9}{4}.$$','task/images/task-3042-explanation-image.jpg'),(251,'По какой кривой плоскость x=0 пересекает поверхность $$\\frac{x^2}{4}+y^2-\\frac{z^2}{4}=0?$$','',1489,'Плоскость x=0 пересекает данный конус по паре пересекающихся прямых, поскольку ограничение уравнения конуса на эту плоскость имеет вид $$y^2-\\frac{z^2}{4}=0.$$','task/images/task-3774-explanation-image.jpg'),(252,'По какой кривой плоскость z=0 пересекает поверхность $$\\frac{x^2}{2}-\\frac{y^2}{4}=3z?$$','',1494,'Плоскость z=0 пересекает данный гиперболический параболоид по паре пересекающихся прямых, поскольку ограничение уравнения, задающего парадолоид, на эту плоскость имеет вид $$\\frac{x^2}{2}-\\frac{y^2}{4}=0.$$','task/images/task-7384-explanation-image.jpg'),(253,'По какой кривой плоскость z=5 пересекает поверхность $$\\frac{x^2}{2}-y^2=4z?$$','',1497,'Плоскость z=5 пересекает данный гиперболический параболоид по гиперболе, поскольку ограничение уравнения, задающего параболоид, на эту плоскость имеет вид $$\\frac{x^2}{2}-y^2=20.$$','task/images/task-3577-explanation-image.jpg'),(254,'По какой кривой плоскость z=-1 пересекает поверхность $$\\frac{x^2}{3}-\\frac{y^2}{2}=z?$$','',1502,'Плоскость z=-1 пересекает данный гиперболический параболоид по гиперболе, поскольку ограничение уравнения, задающего параболоид, на эту плоскость имеет вид $$\\frac{x^2}{3}-\\frac{y^2}{2}=-1.$$','task/images/task-1024-explanation-image.jpg'),(255,'По какой кривой плоскость x=2 пересекает поверхность $$\\frac{x^2}{2}-\\frac{y^2}{6}=3z?$$','',1509,'Плоскость x=2 пересекает данный гиперболический параболоид по параболе, поскольку ограничение уравнения, задающего параболоид, на эту плоскость имеет вид $$\\frac{y^2}{6}=2-3z.$$','task/images/task-4755-explanation-image.jpg'),(256,'По какой кривой плоскость z=-4 пересекает поверхность $$\\frac{x^2}{3}-\\frac{z^2}{4}=\\frac{y}{2}?$$','',1515,'Плоскость z=-4 пересекает данный гиперболический параболоид по параболе, поскольку ограничение уравнения, задающего параболоид, на эту плоскость имеет вид $$\\frac{x^2}{3}=\\frac{y}{2}+4.$$','task/images/task-1022-explanation-image.jpg'),(257,'По какой кривой плоскость z=0 пересекает поверхность $$\\frac{x^2}{2}+\\frac{y^2}{7}=\\frac{z}{3}?$$','',1521,'Плоскость z=0 пересекает данный эллиптический параболоид по паре мнимых пересекающихся прямых (геометрически это точка), поскольку ограничение уравнения, задающего параболоид, на эту плоскость, имеет вид $$\\frac{x^2}{2}+\\frac{y^2}{7}=0.$$','task/images/task-9310-explanation-image.jpg'),(258,'По какой кривой плоскость z=4 пересекает поверхность $$x^2+2y^2=\\frac{z}{3}?$$','',1524,'Плоскость z=4 пересекает данный эллиптический параболоид по эллипсу, поскольку ограничение уравнения, задающего параболоид, на эту плоскость имеет вид $$x^2+2y^2=\\frac{4}{3}.$$','task/images/task-2020-explanation-image.jpg'),(259,'По какой кривой плоскость z=-3 пересекает поверхность $$\\frac{x^2}{3}+4y^2=5z?$$','',1532,'Плоскость z=-3 пересекает данный эллиптический параболоид по мнимому эллипсу (геометрически это означает, что пересечение пусто), поскольку ограничение уравнения, задающего параболоид, на эту плоскость имеет вид $$\\frac{x^2}{3}+4y^2=-15.$$','task/images/task-9856-explanation-image.jpg'),(260,'По какой кривой плоскость y=4 пересекает поверхность $$3x^2+\\frac{y^2}{2}=-z?$$','',1537,'Плоскость y=4 пересекает данный эллиптический параболоид по параболе, поскольку ограничение уравнения, задающего параболоид, на эту плоскость имеет вид $$3x^2=-z-8.$$','task/images/task-6556-explanation-image.jpg'),(261,'По какой кривой плоскость x=-1 пересекает поверхность $$x^2+z^2=\\frac{y}{2}?$$','',1541,'Плоскость x=-1 пересекает данный эллиптический параболоид по параболе, поскольку ограничение уравнения, задающего параболоид, на эту плоскость имеет вид $$z^2=\\frac{y}{2}-1.$$','task/images/task-4390-explanation-image_HeTk5yc.jpg'),(262,'По какой кривой плоскость x=3 пересекает поверхность $$\\frac{x^2}{2}-\\frac{z^2}{4}=1?$$','',1548,'Плоскость x=3 пересекает данный гиперболический цилиндр по паре параллельных прямых, поскольку ограничение уравнения, задающего цилиндр, на эту плоскость имеет вид $$\\frac{z^2}{2}=\\frac{7}{2}.$$','task/images/task-5815-explanation-image.jpg'),(263,'По какой кривой плоскость z=-2 пересекает поверхность $$\\frac{x^2}{3}-\\frac{z^2}{4}=1?$$','',1553,'Плоскость z=-2 пересекает гиперболический цилиндр по паре совпадающих прямых, поскольку ограничение уравнения, задающего цилиндр, на эту плоскость имеет вид $$x^2 - 6=0.$$','task/images/task-9655-explanation-image.jpg');
